///////////////////////////////// 3D THREE JS
function StartToRender() {
    var scene2;
    var camera2;
    var renderer2;
    var controls;
    var plane;
    var oldWidth = imgWidth;
    var oldHeight = imgHeight;
    var videoImageContext;
    var videoImage;
    var materialRGB;
    
    var init = function () {

        scene2 = new THREE.Scene(); // Create a Three.js scene object.
        camera2 = new THREE.PerspectiveCamera(50, 1300 / 700, 0.01, 10000); // Define the perspective camera's attributes.

        renderer2 = window.WebGLRenderingContext ? new THREE.WebGLRenderer() : new THREE.CanvasRenderer(); // Fallback to canvas renderer, if necessary.
        renderer2.setSize(1300, 700); // Set the size of the WebGL viewport.
        document.body.appendChild(renderer2.domElement); // Append the WebGL viewport to the DOM.
        //var materialMap = new THREE.MeshBasicMaterial({map: THREE.ImageUtils.loadTexture('Lenna.png')});

        renderer2.domElement.clientWidth = imgWidth;
        renderer2.domElement.clientHeight = imgHeight;
        var geometry2 = new THREE.PlaneGeometry(imgWidth, imgHeight); // Create a 20 by 20 by 20 cube.
        /////////////
        /////////////
	// VIDEO //
	///////////
	
	// create the video element
	//video = document.createElement( 'video' );
	// video.id = 'video';
	// video.type = ' video/ogg; codecs="theora, vorbis" ';
	//video.src = "LokiRunsDeep.mp4";
	//video.load(); // must call after setting/changing source
	//video.play();
	
	// alternative method -- 
	// create DIV in HTML:
	// <video id="myVideo" autoplay style="display:none">
	//		<source src="videos/sintel.ogv" type='video/ogg; codecs="theora, vorbis"'>
	// </video>
	// and set JS variable:
	// video = document.getElementById( 'myVideo' );
	
        videoImage = document.createElement( 'canvas' );
	//videoImage = document.getElementById( 'video' );
	videoImage.width = 1280;
	videoImage.height = 720;
	videoImageContext = videoImage.getContext( '2d' );
	// background color if no video present
	videoImageContext.fillStyle = '#000000';
	videoImageContext.fillRect( 0, 0, videoImage.width, videoImage.height );
	
        videoTexture = new THREE.Texture( videoImage );
	videoTexture.minFilter = THREE.LinearFilter;
	videoTexture.magFilter = THREE.LinearFilter;
        //// RGB - Shader
        var vertShaderRGB = document.getElementById('vertexShaderRGB').innerHTML;
        var fragShaderRGB = document.getElementById('fragmentShaderRGB').innerHTML;
        var uniformsRGB = {
            //texture1: {type: "t", value: THREE.ImageUtils.loadTexture(srcTexture)},
            texture1: {type: "t", value: videoTexture},
            //texWidth: {type: "f", value: imgWidth},
            //texHeight: {type: "f", value: imgHeight},
            texWidth: {type: "f", value: 1280.0},
            texHeight: {type: "f", value: 720.0},
            R: {type: "f", value: RED},
            G: {type: "f", value: GREEN},
            B: {type: "f", value: BLUE},
            Invert: {type: "i", value: INVERT},
            GrayScale: {type: "i", value: GRAYSCALE},
            GrayScaleMax: {type: "i", value: GRAYSCALE_MAX},
            Blur: {type: "i", value: BLUR},
            GaussianBlur: {type: "i", value: GAUSSIAN_BLUR},
            ContrastingUp1: {type: "i", value: CONTRASTING_UP_1},
            ContrastingUp2: {type: "i", value: CONTRASTING_UP_2},
            ContrastingUp3: {type: "i", value: CONTRASTING_UP_3},
            BordersUnderliningOn: {type: "i", value: BORDERS_UNDERLINING_ON},
            BordersUnderliningSl: {type: "f", value: BORDERS_UNDERLINING_SL},
            BordersUnderliningAlphaSl: {type: "f", value: BORDERS_UNDERLINING_ALPHA_SL},
            RobertsFilterOn: {type: "i", value: ROBERTS_FILTER},
            PrevittaFilterOn: {type: "i", value: PREVITTA_FILTER},
            SobelaFilterOn: {type: "i", value: SOBELA_FILTER},
            MedianFilterOn: {type: "i", value: MEDIAN_FILTER}
                
        };
        var materialRGB = new THREE.ShaderMaterial({
            uniforms: uniformsRGB,
            vertexShader: vertShaderRGB,
            fragmentShader: fragShaderRGB
        });
        //https://github.com/mrdoob/three.js/wiki/Uniforms-types
        //////////////////////////////////////////////

        plane = new THREE.Mesh(geometry2, materialRGB); // Create a mesh based on the specified geometry (cube) and material (blue skin).
        plane.doubleSided = true;
        plane.material.side = THREE.DoubleSide;
        
        scene2.add(plane); // Add the cube at (0, 0, 0).

        camera2.position.z = 650; // Move the camera away from the origin, down the positive z-axis.
        
       
        
        //controls = new THREE.OrbitControls(camera2);
           // RECOMMENT ONLY THIS
        //controls.addEventListener( 'change', render2 );
    };
    function reloadImgInGL()
    {
        plane.material.uniforms.texture1.value = THREE.ImageUtils.loadTexture(srcTexture);
        plane.scale.x *= imgWidth / oldWidth;
        plane.scale.y *= imgHeight / oldHeight;
        plane.material.uniforms.texWidth.value = imgWidth;
        plane.material.uniforms.texHeight.value = imgHeight;
        oldWidth = imgWidth;
        oldHeight = imgHeight;
    }
    var render2 = function () {

                 plane.material.uniforms.texture1.needsUpdate = true;
        plane.material.uniforms.texture1.value._needsUpdate = true;
        plane.material.overdraw = true;
        
        plane.material.uniforms.R.value = RED;
        plane.material.uniforms.G.value = GREEN;
        plane.material.uniforms.B.value = BLUE;
        plane.material.uniforms.Invert.value = INVERT;
        plane.material.uniforms.GrayScale.value = GRAYSCALE;
        plane.material.uniforms.GrayScaleMax.value = GRAYSCALE_MAX;
        
        plane.material.uniforms.Blur.value = BLUR;
        plane.material.uniforms.GaussianBlur.value = GAUSSIAN_BLUR;
        plane.material.uniforms.ContrastingUp1.value = CONTRASTING_UP_1;
        plane.material.uniforms.ContrastingUp2.value = CONTRASTING_UP_2;
        plane.material.uniforms.ContrastingUp3.value = CONTRASTING_UP_3;
        plane.material.uniforms.BordersUnderliningOn.value = BORDERS_UNDERLINING_ON;
        plane.material.uniforms.BordersUnderliningSl.value = BORDERS_UNDERLINING_SL;
        plane.material.uniforms.BordersUnderliningAlphaSl.value = BORDERS_UNDERLINING_ALPHA_SL;
        plane.material.uniforms.RobertsFilterOn.value = ROBERTS_FILTER;
        plane.material.uniforms.PrevittaFilterOn.value = PREVITTA_FILTER;
        plane.material.uniforms.SobelaFilterOn.value = SOBELA_FILTER;
        plane.material.uniforms.MedianFilterOn.value = MEDIAN_FILTER;
        
        FPSAdd();
        //plane.rotation.y += 0.05;

        if (LOADIMG) {
            if (RELOADED) {
                reloadImgInGL();
                LOADIMG = false;
                RELOADED = false;
            }
        }
        
        renderer2.render(scene2, camera2); // Each time we change the position of the cube object, we must re-render it.

        requestAnimationFrame(render2); // Call the render() function up to 60 times per second (i.e., up to 60 animation frames per second).
        /*renderer2.context.canvas.onblur = function () {
            alert("1");
        controls.update();
        };
        
        */
       videoImageContext.drawImage(document.getElementById("video"), 0, 0 );
       videoTexture.needsUpdate = true;
       //materialRGB.uniforms.texture1.needsUpdate = true;
       plane.material.uniforms.texture1.needsUpdate = true;
       /*
       if ( video.readyState === video.HAVE_ENOUGH_DATA ) 
	{
		videoImageContext.drawImage( video, 0, 0 );
		if ( videoTexture ) 
			videoTexture.needsUpdate = true;
	}
        */
        
    };
    init();
    //cameraAction();
    render2(); // Start the rendering of the animation frames.
};